import React, { FC } from 'react';
import { View, StyleSheet } from 'react-native';

const styles = StyleSheet.create({
  container: {
    flex: 1,
    alignItems: 'center',
    justifyContent: 'center',
    flexWrap: 'wrap',
  },
  text: { fontSize: 20 },
  color: { width: 80, height: 80 },
});

const Home: FC = () => (
  <View style={styles.container}>
    <View style={[styles.color, { backgroundColor: 'pink' }]}></View>
  </View>
);

export default Home;
